import React from 'react';
import { View, Text } from 'react-native';

export default function Home() {
 return (
   <View>
     <Text style={{marginTop: 60, fontSize: 25, fontFamily: 'Anton_400Regular'}}>Pagina Home</Text>
   </View>
  );
}
